import React from 'react'

function nav() {


    const enabled = "false";

    function isEnabled(enabled){
        if(enabled == "true"){
            return "/myAccount";
        } else {
            return "/";
        }
    }


    return (
        <div className = "nav">
            <ul className = "nav-ul">
                <li>
                    <a href="/home">home</a>      
                </li>
                <li>
                    <a href="/calanderView">Calander view</a>
                </li>
                <li>
                    <a href="/myAccount" href={isEnabled("false")}>my account</a>
                </li>
                <li>
                    <a class = "isDisabled">log out</a>
                </li>
            </ul>
        </div>

    )
}

export default nav
